    body.fix-position {
      left: 0;
      overflow: hidden;
      position: fixed;
      right: 0
    }

    button {
      color: inherit
    }

    .global-header-container {
      grid-area: header;
      -ms-grid-column: 1;
      -ms-grid-row: 1
    }

    main {
      grid-area: main;
      -ms-grid-column: 1;
      -ms-grid-row: 2;
      padding-top: 1.5rem
    }

    main:focus {
      outline: none
    }

    main:focus-visible {
      outline: 2px solid #9754e6;
      outline-offset: -2px
    }

    @media (min-width:61.25rem) {
      main {
        padding-top: 1.75rem
      }
    }

    footer {
      grid-area: footer;
      -ms-grid-column: 1;
      -ms-grid-row: 3
    }

    body {
      display: grid;
      font-family: Apercu Pro, Helvetica, Arial, sans-serif;
      grid-template-areas: "header" "main" "footer";
      grid-template-columns: 100%;
      grid-template-rows: auto minmax(min-content, 1fr) auto;
      height: 100vh
    }

    .qa-mode-notification {
      margin-bottom: 100px
    }

    .qa-mode-notification spark-notification {
      --ep-notification-content-max-width: none
    }

    .sds-breadcrumb a {
      color: #3d4846;
      text-decoration: underline
    }

    .sds-breadcrumb a:hover,
    .sds-breadcrumb a:visited:hover {
      color: #3d4846;
      text-decoration-color: #9653e5;
      text-decoration-thickness: 3px
    }

    .sds-breadcrumb li+li:before {
      border-right: 1px solid #a3aeac
    }

    .sds-breadcrumb.sds-breadcrumb--mobile-custom li.sds-breadcrumb__parent {
      display: flex
    }

    @media (min-width:48rem) {
      .sds-breadcrumb.sds-breadcrumb--mobile-custom li.sds-breadcrumb__parent {
        display: none
      }
    }

    input[type=range] {
      -webkit-appearance: none;
      background: transparent;
      height: 30px;
      margin: 0;
      overflow: hidden;
      width: 100%
    }

