          ele.outerFind('a.cui-button.finance-question-button').keydown(function (e) {
            if (e.keyCode === 13 || e.keyCode === 32) {
              e.preventDefault();
              setTimeout(function () {
                var closebtn = '.dialog__content-head .icon--target';
                AudioEye.focusElement(closebtn);
                keyboardClick(closebtn);
                api.convertToBtn(closebtn).attr('aria-label', 'Close');
                $ae(closebtn).click(function () {
                  setTimeout(function () {
                    AudioEye.focusElement('a.cui-button.finance-question-button');
                  }, 500);
                });
              }, 2000);
              AudioEye.modals.enableTabLoop('.dialog');
            }
          });

          // Close btn loses tabindex
          $ae('.dialog__content-head .icon--target').attr('tabindex', '0');
        };
