              // if($ae('.sds-filter.active').attr('data-value') === 'All') {

              // }
            })

            .find('.sds-filter')
            // TABS
            .each(function (idx) {
              // Save for aria-labelledby reference
              let labelId = $ae(this).attr('id') ? $ae(this).attr('id') : `ae-sdsFilterTab${idx}`;

              // role, state, tabindex, id reference
              if ($ae(this).hasClass('active')) {
                $ae(this).attr({ 'role': 'tab', 'aria-selected': 'true', 'tabindex': '0', 'id': labelId });
                // Tabpanel label
                $ae(this).closest('.sds-page-section__container').find('.body-style-categories-container').attr({ 'aria-labelledby': labelId });
              } else {
                $ae(this).attr({ 'role': 'tab', 'aria-selected': 'false', 'tabindex': '-1', 'id': labelId });
              }
            })
            // KeyClick
            .keydown(function (e) {
              if (e.keyCode === 13 || e.keyCode === 32) {
                e.preventDefault();
                $ae(this).click();
              }
            })
            // Click
            .click(function () {
              // Update state and tabindexes
              $ae(this).attr({ 'aria-selected': 'true', 'tabindex': '0' })
                .siblings().attr({ 'aria-selected': 'false', 'tabindex': '-1' });

